import React from 'react';
import Card from '../Card/Card.js';
import './Cards.css'

const Cards = ({busqueda})=>{
    const elementosMostrados = busqueda.slice(2, 17); // Obtener los elementos del índice 2 al 16

    return (
        <div className='contenedor'>

           {
            
            elementosMostrados.map((element, index) => (
                <Card key={index} data={element} />
            )) 
            }

        </div>
    )
}

export default Cards;
